import React from "react";

function Open() {

    return (
        <div className="form">
            <h3 className="h3open">Öppettider</h3>
            <div className="containeropen">
                <div className="thirdopen">
                    <h1>Öppettider</h1>
                </div>
                <div className="thirdopen">
                    <h1>Här hittar du oss</h1>
                </div>
                <div className="thirdopen">
                    <h1>Kontakt</h1>
                </div>
            </div>
        </div>
    );
}
export default Open;
